import SidebarMenu from 'react-bootstrap-sidebar-menu'
import { faNewspaper } from '@fortawesome/fontawesome-free-regular';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Sidebar(props){
    return(
         <>
           <SidebarMenu>
            <SidebarMenu.Header>
              <SidebarMenu.Brand>
                 <FontAwesomeIcon icon={faNewspaper} size='50%' spacing={3} style={{height:"25px", width:"25px", margin:"5px"}}/>
              <SidebarMenu.Text className='m-2'>News Bulation</SidebarMenu.Text>
              </SidebarMenu.Brand>
              <SidebarMenu.Toggle/>
            </SidebarMenu.Header>
           </SidebarMenu>
         </>
    );
}

export default Sidebar;
